import { types } from "mobx-state-tree";

export const abilitie=types.model({
    name: types.string,
    url: types.string
})

export const sprite=types.model({
    back_default:types.string,
    back_shiny:types.string,
})

export const pokemon1=types.model({
        abilities:types.optional(types.array(abilitie),[]),
        sprites:types.optional(sprite,{})
        // id:types.string
})
export const infor=types.model('infor',{
    Title:types.string,
    Poster:types.string,
    imdbID:types.string,
})
export  const listBookmark=types.model({
    list:types.optional(types.array(infor),[])
    })
export const listfilm=listBookmark.create()
export const pokemon=pokemon1.create()
